import Styles from "./Header.modules.css";

export function Header() {
    return (
        <header className={Styles.header}>
            <span>Cinephile</span>
            <nav>
                <a href="#">Home</a>
                <a href="#">Assistir</a>
            </nav>
        </header>
    );
}
